Im otw to catch a train but tl;dr, you'll need to 
1. Create env-local-overrides.json in the same folder there's env-local.json
2. Put this in there:
{
"base": {
 "AIHUB_UDF_EXECUTION": "LOCAL"
}
}
3. Then you'll need to restart api-server and celery-app-tasks via `cs restart api-server && cs restart celery-app-tasks`
